This method will be executed when installing the extension in AppDelegate lifecycle. This is before all the extensions are ready, because a single extension is being installed at the time. Be sure to call the [super install] method. - (void) install { [super install]; // your code here
} self.handlers The handlers are the names of the native bridges that will be called when used inside the webview. Must be configured in the install method. See JLKeychain extension as an example with using handlers. - (void) install { // ... self.handlers = @{ @"$keychain.set": setHandler, @"$keychain.get": getHandler, @"$keychain.remove": removeHandler, @"$keychain.clear": clearHandler };
} Handlers A handler is a native function that is called within the webview. Handlers will be called using $agent.trigger() inside the webview. Example: $agent.trigger('$keychain.get') They will return a JS Promise . A wrapper can be created to call directly. Example: JLContacts.js (() => { if (window && window.$myextension) { return; } window.$myextension = {}; window.$myextension.run = () => $agent.trigger("$myextension.run", {}); })();

